import React, {useState} from 'react'; 

function Checkbox(props) { 


  const date = new Date();
  const [checked, setChecked] = useState(false); 
  var current_date = "  "+ date.getFullYear()+"-"+(date.getMonth()+1)+"-"+ date.getDate()
   + "  " + date.getHours()+":" +date.getMinutes()+":"+date.getSeconds(); 

  const handleChange = () => { 

    setChecked(!checked);
    current_date = "  "+ date.getFullYear()+"-"+(date.getMonth()+1)+"-"+ date.getDate()
   + "  " + date.getHours()+":" +date.getMinutes()+":"+date.getSeconds(); 


  }; 


  return ( 

    <div > 
      <div style={ {display:'flex',  alignItems: 'normal',
            justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}}>
       <input type="checkbox" onChange ={handleChange}/>
       </div>
      <h8 style={ {display:'flex',  alignItems: 'normal',
            justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}}>
        {checked ? 'Completed: '+current_date : 'Not Completed'}
      </h8> 

    </div> 

  ); 

}; 

export default Checkbox;
